import { push as Menu } from 'react-burger-menu';
import React from 'react';
import './Sidebar.css'
import { Link } from 'react-scroll'

class Sidebar extends React.Component {
  render () {
    // NOTE: You also need to provide styles, see https://github.com/negomi/react-burger-menu#styling
    return (
      <Menu className='sideBar'>
            <ul>
                <li className='NoStyleList'>
                    <Link
                        activeClass='active'
                        className='linkclick menu-item-bar-actu'
                        to='accueil'
                        spy={true}
                        smooth={true}
                        offset={-70}
                        duration={500}>
                        Home
                    </Link>
                </li>
                <li className='NoStyleList '>
                    <Link
                        activeClass='active'
                        className='linkclick menu-item-bar-actu'
                        to='aboutus'
                        spy={true}
                        smooth={true}
                        offset={-30}
                        duration={500}>
                        About us
                    </Link>
                </li>
                <li className='NoStyleList'>
                    <Link
                        activeClass='active'
                        className='linkclick'
                        to='news'
                        spy={true}
                        smooth={true}
                        offset={-30}
                        duration={500}>
                        News
                    </Link>
                </li>
                <li className='NoStyleList'>
                    <Link
                        activeClass='active'
                        className='linkclick'
                        to='contact'
                        spy={true}
                        smooth={true}
                        offset={-30}
                        duration={500}>
                        Contact
                    </Link>
                </li>
            </ul>
      </Menu>
    );
  }
}

export default Sidebar
